body:
我想把TaskFlow接口中的text_similarity近义词判断接口部署成一个server服务，目前写好了python脚本也正常部署好了服务端，但是不太清楚如何进行传参，看近义词文档中的描述貌似是传一个二维数组进去：
similarity([["春天适合种什么花？", "春天适合种什么菜？"]])
不过我传如下的json进去总是报错（传一维数组也是报错）：
{
    "data": {
        "text": [[
            "春天适合种什么花？",
            "春天适合种什么菜？"
        ]]
    }      
}
TypeError: Invalid input format.
请问这种接口部署成服务端应该如何传参呢

### 请提出你的问题

## 环境

- 【FastDeploy版本】： 
- 【编译命令】[官方编译](https://github.com/PaddlePaddle/FastDeploy/blob/develop/docs/cn/build_and_install/download_prebuilt_libraries.md#c-sdk%E5%AE%89%E8%A3%85)
- 【系统平台】: Windows x64(Windows11) 
- 【硬件】： Nvidia GPU 3060， CUDA 11.7 CUDNN 8.4
- 【编译语言】： C++
- 【IDE】： VS2022

测试代码
```c++
#include <fast_tokenizer/tokenizers/ernie_fast_tokenizer.h>

using namespace paddlenlp::fast_tokenizer;

int main() {
  std::cout << "start ..." << std::endl;
  tokenizers_impl::ErnieFastTokenizer ernie_fast_tokenizer("model/vocab1.txt");
  std::vector<core::Encoding> encodings(2);
  ernie_fast_tokenizer.EncodePairStrings("今天天气真好", &encodings[0]);
  std::cout << encodings[0].DebugString() << std::endl;
  ernie_fast_tokenizer.EncodePairStrings(
      "don't know how this missed award nominations.", &encodings[1]);
  std::cout << encodings[0].DebugString() << std::endl;
  std::cout << "end ..." << std::endl;
}
```
